import React, { Component} from 'react';
import {Grid, Cell} from 'react-mdl';

class Landing extends Component{
	render(){
		return(
			<div style = {{width: '100%', margin: 'auto'}}>
				<Grid className = "landing-grid">
					<Cell col={12}>
						<img
							src = "https://www.australia.com/content/australia/en_ie/facts/pictures/australias-animal-pictures/dingo/jcr:content/image.adapt.1200.HIGH.jpg"
							alt = "avatar"
							className = "avatar-img"
							/>

					<div className = "banner-text">
						<h4><i>Looks like you have stumbled onto my page!</i></h4>
						<hr/>
						<p>That is a picture of a dingo not me! Feel free to explore and learn more about my experience as a developer.
						</p>
					</div>
					</Cell>
				</Grid>
			</div>
		)
	}
}

export default Landing;
